const main = (context, tags, suffix) => {
	const block0 = (context) => { return html`<div class="ui5-cp-item" style="background-color: ${ifDefined(context.value)}" value="${ifDefined(context.value)}" tabindex="${ifDefined(context._tabIndex)}" role="button" aria-label="${ifDefined(context.colorLabel)} - ${ifDefined(context.index)}: ${ifDefined(context.value)}" title="${ifDefined(context.colorLabel)} - ${ifDefined(context.index)}: ${ifDefined(context.value)}" ?disabled="${context._disabled}"></div>`; };


	return block0(context);
};

export default main;
